import React from "react";

const MovieCard = ({ movie }) => {
  return (
    <>
      <div className="card ">
        <div className="name ">Movies - {movie.Title}</div>
        <div className="image">
          <img src={movie.Poster} alt="Image is Not Yet" />
        </div>
        <div className="year">{movie.Year}</div>
      </div>
    </>
  );
};

export default MovieCard;
